function getCartFromStorage(t){try{var r=JSON.parse(localStorage.getItem("cart"));if(!r)throw new Error("Cart isnt passing to this page");var a=r.map(function(t){return'<div class= "shopping-cart__put__item"><img class="shopping-cart__put__item__item-image" src='+t.imgSrc+' alt=""><h2  class="shopping-cart__put__item__item-name">'+t.description+'</h2><h3  class="shopping-cart__put__item__item-price">$'+t.price+'</h3><input class="shopping-cart__put__item__count" name="value" type="number" value="0" min="0" max="50"> </div>'}).join("");t.innerHTML=a}catch(t){console.error(t)}}try{var shoppingCartDOM=document.querySelector(".shopping-cart__put");if(!shoppingCartDOM)throw new Error("No cart to display items");getCartFromStorage(shoppingCartDOM)}catch(t){console.error(t)}